import { AppBar, Toolbar, Typography } from "@material-ui/core";

const Header = () => {
  return (
    <AppBar position="static">
      <Toolbar>
        <Typography variant="h5" noWrap>
          <Box>
          RCC Brass
          </Box>
        </Typography>
      </Toolbar>
    </AppBar>
  )
}

export default Header
